    <div class="window">
      <img src="src/img/check.png" alt="" srcset="">
      <h2 class="success-text">Right answer</h2>
      <p id="answer">You picked the right answer</p>
      <button class="success" id="nextQuestion">Next question</button>
    </div>
  </div>

  <audio src="./src/audio/success.mp3" id="uiAudio"></audio>
  <script src="https://unpkg.com/@panzoom/panzoom@4.5.1/dist/panzoom.min.js"></script>
  <script>
    const elem = document.getElementById('panzoom')
    const panzoom = Panzoom(elem, {
      maxScale: 10
    })
    panzoom.pan(10, 10)
    panzoom.zoom(1, { animate: false })
  </script>
  <script src="script.js"></script>
</body>
